COMPONENT.script:
Required database name for repository database: or62demos Required database name for demo data database: demodb (containing the Ingres demo data, extended for OpenROAD) Required vnode name: remotehost Required Workbench profile name: or62demos
/* ** RunDemos_I */ Required components: none Required included applications: none Other requirements: Powerpoint presentation OpenROAD6.2NewFeatures-Overview.pptx
Demo: w4gldev rundbapp remotehost::or62demos d201504_rundemos -crundemos_I - Note that a transparent "list" of numbered toggles will display. Some numbers will be suffixed with .1, .2 etc. Whenever the presentation reaches a demo page (one whose page number corresponds to a toggle number), hit the "b" key to blank the presentation tick that toggle to start the demo. When the demo is complete, close the demo (for Workbench demos, be sure to close Workbench itself) hit the "b" key to redisplay the presentation.
/* ** RunDemos_II */ Required components: none Required included applications: none Other requirements: Powerpoint presentation OpenROAD6.2NewFeatures-GenericMechanisms_I.pptx
Demo: w4gldev rundbapp remotehost::or62demos d201504_rundemos -crundemos_II - Note that a transparent "list" of numbered toggles will display. Some numbers will be suffixed with .1, .2 etc. Whenever the presentation reaches a demo page (one whose page number corresponds to a toggle number), hit the "b" key to blank the presentation tick that toggle to start the demo. When the demo is complete, close the demo (for Workbench demos, be sure to close Workbench itself) hit the "b" key to redisplay the presentation.
/* ** RunDemos_III */ Required components: none Required included applications: none Other requirements: Powerpoint presentation OpenROAD6.2NewFeatures-GenericMechanisms_II.pptx
Demo: w4gldev rundbapp remotehost::or62demos d201504_rundemos -crundemos_III - Note that a transparent "list" of numbered toggles will display. Some numbers will be suffixed with .1, .2 etc. Whenever the presentation reaches a demo page (one whose page number corresponds to a toggle number), hit the "b" key to blank the presentation tick that toggle to start the demo. When the demo is complete, close the demo (for Workbench demos, be sure to close Workbench itself) hit the "b" key to redisplay the presentation.

initialize()=
declare
	tgl			= ToggleField default null;
	slide		= varchar(32) not null;
	demo		= varchar(256) not null;
	cmd			= varchar(256) not null;
	cmdstem		= varchar(256) not null default
					'w4gldev rundbapp remotehost::or62demos ';
enddeclare
{
	cursession.ProcessWait = FALSE;
}


on childclick =
{
	tgl = curframe.TriggerField;
	tgl.SetFieldValue(value=TRUE);
	slide = tgl.TextLabel;

	case slide of

	'9':	demo = 'd201504_propertychanger -cw7styler';
	'10.1':	demo = 'd201504_videos_old';
	'10.2':	demo = 'd201504_videos';
	'10.a':	demo = 'd201504_videosconverted';
	'11.1':	demo = 'd201504_videosconverted';
	'11.2':	demo = 'd201504_fieldenhancements -cbdptabhighlighing';
	'12':	demo = 'd201504_definedresponses_sprites -cprogressbars_coded';
	'15':	demo = 'w4gldev runimage workbnch.img -Tall -/appflags profile=or62demos application=d201504_frequentflyer';	//userclass generator - FrequentFlyer User_profile
	'19':	demo = 'w4gldev runimage workbnch.img -Tall -/appflags profile=or62demos application=d201504_frequentflyer';	//display generator - FrequentFlyer User_profileDetails
	'22':	demo = 'w4gldev runimage workbnch.img -Tall -/appflags profile=or62demos application=d201504_imagemapping component=countymap, command=open';	//County map
	'22.a':	demo = 'd201504_imagemapping -csetupcountymap';
	'24':	demo = 'd201504_imagemapping -ccountymap_ready';
	'26':	demo = 'd201504_allocationsystems -cairlineseating';
	'29':	demo = 'w4gldev runimage workbnch.img -Tall -/appflags profile=or62demos application=d201504_outofbox';	//table_editor
	'35.a':	demo = 'w4gldev runimage workbnch.img -Tall -/appflags profile=or62demos application=d201504_imagemapping component=countymap, command=open';	//countymap
	'42':	demo = 'd201504_definedresponses_panel -cpassportdetails';
	'42.a':	demo = 'w4gldev runimage workbnch.img -Tall -/appflags profile=or62demos application=d201504_definedresponses_panel component=passportdetails, command=openscript';	//PassportDetails no code

	default: demo = 'none';
	endcase;

	if demo = 'none' then
		resume;

	elseif demo like '%runimage%' then
		cmd = demo;
		call system :cmd;

	else
		cmd = cmdstem + demo;
		call system :cmd;
	endif;

}

